d = ""
string = ""
length = 0
# Part 2
for index, char in enumerate(d):
    if char in string:
        string = string[string.find(char)+1:] + char
        length = len(string)
    else:
        length += 1
        string += char
        if length == 14: # == 4 here for Part 1
            print(string, index+1)
            break
